import React from 'react';

const ProductItem = ({ product }) => {
  const handleClick = () => {
    window.location.href = product.link;
  };

  return (
    <div className="product-item" onClick={handleClick}>
      <img src={product.photo} alt={product.name} />
      <p>{product.name}</p>
    </div>
  );
};

export default ProductItem;
